            <div class="DnnModule DnnModule-PapMainPageInfo DnnModule-615"><a name="615"></a><div id="dnn_ctr615_ContentPane"><!-- Start_Module_615 --><div id="dnn_ctr615_ModuleContent" class="DNNModuleContent ModPapMainPageInfoC">
	

<img alt="Pozioma linia" style="width: 100%" height="24px" src='/Portals/_default/Containers/DarkKnight/Images/Title-BG-Grey2.png'/>
<div id="dnn_ctr615_PapMainPageInfo_panelDu">
		
    Zgodnie z ustawą z dnia 20 lipca 2000 r. o ogłaszaniu aktów normatywnych i niektórych
    innych aktów prawnych (Dz. U. z 2017 r. poz. 1523), Dziennik
    Ustaw Rzeczypospolitej Polskiej (Dziennik Ustaw) wydaje Prezes Rady Ministrów przy
    pomocy Rządowego Centrum Legislacji.
    <br />
    <br />
    Od 1 stycznia 2012 r. Dziennik Ustaw wydawany jest w formie elektronicznej, z zachowaniem
    kolejności pozycji w danym roku kalendarzowym. W Dzienniku Ustaw ogłaszane są akty
    normatywne i inne akty prawne. Dniem ogłoszenia aktu jest dzień jego ogłoszenia
    w postaci elektronicznej na stronie internetowej organu wydającego Dziennik Ustaw.
    Dzień ogłoszenia aktu w postaci elektronicznej umieszczony jest w obrębie nagłówka
    strony.
    <br />
    <br />
    <div id="dnn_ctr615_PapMainPageInfo_RadPanelBar1" class="RadPanelBar RadPanelBar_Default">
			<ul class="rpRootGroup">
				<li class="rpItem rpFirst rpLast"><a href="#" class="rpLink rpExpandable"><span class="rpOut"><span class="rpExpandHandle"></span><span class="rpText">Wykaz aktów prawnych publikowanych w Dzienniku Ustaw Rzeczypospolitej Polskiej</span></span></a><div class="rpSlide">
					<ul class="rpGroup rpLevel1 ">
						<li class="rpItem rpFirst rpLast"><div class="rpTemplate">
							
                            <p style="text-align: justify; margin-left: 10px">
                                <span style="text-decoration: underline">W Dzienniku Ustaw ogłasza się: </span>
                                <ol class="NormalOl">
                                    <li class="NormalLi">Konstytucję;</li>
                                    <li class="NormalLi">ustawy;</li>
                                    <li class="NormalLi">rozporządzenia z mocą ustawy wydane przez Prezydenta Rzeczypospolitej Polskiej;</li>
                                    <li class="NormalLi">rozporządzenia wydane przez Prezydenta Rzeczypospolitej Polskiej, Radę Ministrów,
                                        Prezesa Rady Ministrów, ministrów kierujących działami administracji rządowej, przewodniczących
                                        określonych w ustawach komitetów, będących członkami Rady Ministrów, oraz Krajową
                                        Radę Radiofonii i Telewizji;</li>
                                    <li class="NormalLi">teksty jednolite aktów określonych w pkt 1-4;</li>
                                    <li class="NormalLi">orzeczenia Trybunału Konstytucyjnego dotyczące aktów normatywnych ogłoszonych w
                                        Dzienniku Ustaw;</li>
                                    <li class="NormalLi">uchwały Rady Ministrów uchylające rozporządzenie ministra, a także akty prawne dotyczące:
                                        <ol class="NormalOl">
                                            <li class="NormalLi">stanu wojny i zawarcia pokoju; </li>
                                            <li class="NormalLi">referendum ogólnokrajowego, w tym referendum zatwierdzającego zmianę Konstytucji;
                                            </li>
                                            <li class="NormalLi">skrócenia kadencji Sejmu; </li>
                                            <li class="NormalLi">wyborów do Sejmu i Senatu; </li>
                                            <li class="NormalLi">wyborów Prezydenta Rzeczypospolitej Polskiej; </li>
                                            <li class="NormalLi">powszechnej lub częściowej mobilizacji i użycia Sił Zbrojnych do obrony Rzeczypospolitej
                                                Polskiej;</li>
                                            <li class="NormalLi">stanu wojennego;</li>
                                            <li class="NormalLi">stanu wyjątkowego;</li>
                                            <li class="NormalLi">stanu klęski żywiołowej;</li>
                                            <li class="NormalLi">ważności wyboru Prezydenta Rzeczypospolitej Polskiej, wyborów do Sejmu i Senatu,
                                                wyborów do Parlamentu Europejskiego oraz ważności referendum ogólnokrajowego, w
                                                tym referendum zatwierdzającego zmianę Konstytucji, oraz inne akty prawne, jeżeli
                                                odrębne ustawy tak stanowią.</li>
                                        </ol>
                                    </li>
                                </ol>
                            </p>
                        
						</div></li>
					</ul>
				</div></li>
			</ul><input id="dnn_ctr615_PapMainPageInfo_RadPanelBar1_ClientState" name="dnn_ctr615_PapMainPageInfo_RadPanelBar1_ClientState" type="hidden" />
